import {
    container as stlye_container,
    rightContainer as style_rightContainer,
    row as style_row
} from './index.module.css';

const FilmCard = ({
    title,
    index,
    image
}) => {
    return <div
        key={'films-' + index}
        className={stlye_container}
    >
        <img
            src={image}
            height="200px"
        />
        <div
            className={style_rightContainer}
        >
            <div
                className={style_row}
            >

            </div>
            <span>{title}</span>
            <p className="" />
        </div>
    </div>
};
export default FilmCard;
